import React, { useEffect, useState, useCallback } from 'react';
import '../css/orders.css'; // Import the updated CSS

const Orders = () => {
    const [orders, setOrders] = useState([]);
    const [error, setError] = useState(null);
    const [userRole, setUserRole] = useState(null);
    const [userId, setUserId] = useState(null);
    const [vendorId, setVendorId] = useState(null);

    const fetchOrders = useCallback(async () => {
        try {
            const token = localStorage.getItem('token');
            if (!token) {
                throw new Error('No token found in localStorage');
            }

            const decodedToken = JSON.parse(atob(token.split('.')[1]));
            const role = decodedToken.userRole;
            const id = decodedToken.id;
            
            setUserRole(role);
            setUserId(id);

            if (role === '2') {
                // Fetch vendor ID if user is a vendor owner
                const vendorResponse = await fetch(`http://localhost:8080/uservendors/${id}`, {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });

                if (!vendorResponse.ok) {
                    throw new Error('Failed to fetch vendor ID');
                }

                const vendorData = await vendorResponse.json();
                console.log('Vendor Data:', vendorData); // Log vendor data to verify
                const vendorId = vendorData.vendor_id; // Ensure this is the correct field
                if (!vendorId) {
                    throw new Error('Vendor ID is undefined');
                }

                setVendorId(vendorId);

                // Fetch orders for the vendor
                const ordersResponse = await fetch(`http://localhost:8080/vendororders/${vendorId}`, {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });

                if (!ordersResponse.ok) {
                    throw new Error('Network response was not ok');
                }

                const data = await ordersResponse.json();
                setOrders(data.orders || []);
            } else {
                // Non-vendor user: Fetch their orders directly
                const ordersResponse = await fetch(`http://localhost:8080/uservendors/${id}`, {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });

                if (!ordersResponse.ok) {
                    throw new Error('Network response was not ok');
                }

                const data = await ordersResponse.json();
                setOrders(data.orders || []);
            }
        } catch (error) {
            setError('Error fetching orders. Please try again.');
            console.error('Error fetching orders:', error);
        }
    }, []);

    useEffect(() => {
        fetchOrders(); // Call fetchOrders on component mount
    }, [fetchOrders]);

    const handleCompleteOrder = async (orderId) => {
        try {
            const response = await fetch(`http://localhost:8080/orderscompleted/${orderId}`, {
                method: 'PUT',
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('token')}`,
                    'Content-Type': 'application/json'
                }
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            // Refresh the orders after updating
            await fetchOrders();
        } catch (error) {
            setError('Error updating order status. Please try again.');
            console.error('Error updating order status:', error);
        }
    };

    return (
        <div className="orders-container">
            <div className="orders-card">
                <div className="orders-header">Orders</div>
                {error && <p className="error-message">{error}</p>}
                <div className="orders-list">
                    {orders.map(order => (
                        <div key={order.id} className="order-item">
                            <div className="order-details">
                                <strong>Total Cost:</strong> ${order.total_order_cost}
                            </div>
                            <div className="order-details">
                                <strong>Status:</strong> {order.status}
                            </div>
                            <div className="order-vendor">
                                <strong>Vendor Name:</strong> {order.vendor_name}
                            </div>
                            <div className="order-items">
                                <strong>Items:</strong>
                                {order.item_names && order.item_names.map((item, index) => (
                                    <div key={index} className="order-item-details">
                                        <span>{item}</span>
                                        <span>${order.item_prices[index]}</span>
                                    </div>
                                ))}
                            </div>
                            {userRole === '2' && order.status !== 'completed' && (
                                <button onClick={() => handleCompleteOrder(order.id)}>Mark as Completed</button>
                            )}
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Orders;
